import React,{ useState } from 'react';
import { Box, Container, Card, CardContent, Typography , Grid , List , ListItem , ListItemText , Button , Snackbar , Dialog , Slide , LinearProgress , AppBar , IconButton , Toolbar } from '@material-ui/core';
import CloseIcon from '@material-ui/icons/Close';
import { Alert, AlertTitle } from '@material-ui/lab';
import { useDropzone } from 'react-dropzone';
import styled from 'styled-components';
import axios from 'axios';
import { OutTable , ExcelRenderer } from 'react-excel-renderer';
import { saveAs } from "file-saver";
import { Document, HorizontalPositionAlign, HorizontalPositionRelativeFrom, Media, Packer, Paragraph, Header, VerticalPositionAlign, VerticalPositionRelativeFrom, Table, TableRow, WidthType, TableCell, VerticalAlign, HyperlinkRef, HyperlinkType } from "docx";

import store from "src/store.js";
import { API_URL } from 'src/helpers/utils.js';
import Page from 'src/components/Page';
import FormatForm from './FormatForm.js'

const getColor = (props) => {
  if (props.isDragAccept) {
      return '#00e676';
  }
  if (props.isDragReject) {
      return '#ff1744';
  }
  if (props.isDragActive) {
      return '#2196f3';
  }
  return '#eeeeee';
}

const DropBox = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 100px;
  border-width: 2px;
  border-radius: 2px;
  border-color: ${props => getColor(props)};
  border-style: dashed;
  background-color: #fafafa;
  color: #bdbdbd;
  outline: none;
  transition: border .24s ease-in-out;
`;

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="up" ref={ref} {...props} />;
});

var secondaryPage = [];

function capitalize(string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
}

var returnTableFromRows = (rows) => {
    return new Table({
        cantSplit: true,
        columnWidths: [20,80],
        width: {
            size: 100,
            type: WidthType.PERCENTAGE,
        },
        rows: [rows.secondaryTableData_Publication, rows.secondaryTableData_Headline, rows.secondaryTableData_DailyPageViews] 
    }) 
}

function FileDropView(props) {
  const {acceptedFiles, getRootProps, getInputProps, isDragActive, isDragAccept, isDragReject} = useDropzone({accept:"text/csv , application/vnd.oasis.opendocument.spreadsheet , application/vnd.ms-excel , application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"});

  const [table, setTable] = useState(false)
  const [dialog, setDialog] = useState(true);
  const [dialogCloseBtn, setDialogCloseBtn] = useState(true);
  const [loader, setLoader] = useState(false);
  const [finalList, setFinalList] = useState([]);
  const [imgHeader, setimgHeader] = useState({name:"*Nothing Selected*"})

  const docxFile = async (data,format) => {
    var links = {};    
    var IMAGE_BUFFER="";

    // await getBase64(imgHeader, (result) => {
    //     IMAGE_BUFFER = result.split(",")[1]
    //     console.log(IMAGE_BUFFER)
    // });

    var varietyStr = format.primaryTable.stats.variety==='Page-Viewers' ? "Page Viewers" : "Page Visitors";
    var typeStr = "Daily "
    if (format.primaryTable.stats.type==='Monthly') 
      typeStr="Monthly "
    else if(format.primaryTable.stats.type==='Yearly') 
      typeStr="Yearly "

    for (let i = 0; i < data.length; i++) {
      var item = data[i];
      links["link_"+i]={
          link: item.articleDetails.articleURL,
          text: item.articleDetails.articleHeadline,
          type: HyperlinkType.EXTERNAL,
        }      
    }

    const doc = new Document({
        creator: "get-measurements.com",
        description: "Detailed Client Report",
        title: "Client Report",
        hyperlinks: links
    });

    var mainTableRows = [
        new TableRow({
            children: [
                new TableCell({
                    children: [new Paragraph({text:"S. No."})],
                    verticalAlign: VerticalAlign.CENTER
                }),
                new TableCell({
                    children: [new Paragraph({text: "Publication"})],
                    verticalAlign: VerticalAlign.CENTER
                }),
                new TableCell({
                    children: [new Paragraph({ text: "Headline" })],
                    verticalAlign: VerticalAlign.CENTER
                }),
                new TableCell({
                    children: [new Paragraph({ text: typeStr+varietyStr })],
                    verticalAlign: VerticalAlign.CENTER
                }),
            ],
            tableHeader: true,                
        }
    )];

    for (let i = 0; i < data.length; i++) {
        var item = data[i];
        var publication_name;        

        if(item.siteDetails.site_name.split('.').length=='3')
          publication_name=capitalize(item.siteDetails.site_name.split('.')[1])
        else 
          publication_name=capitalize(item.siteDetails.site_name.split('.')[0])

        mainTableRows.push(
            new TableRow({
                children: [
                    new TableCell({
                        children: [new Paragraph({text: ""+(i+1)})],
                        verticalAlign: VerticalAlign.CENTER,
                        margins: {
                          left: 10,
                        }
                    }),
                    new TableCell({
                        children: [new Paragraph({text:publication_name})],//capitalise first letter pending
                        verticalAlign: VerticalAlign.CENTER,
                        margins: {
                          left: 10,
                        }
                    }),
                    new TableCell({
                        children: [new Paragraph({
                            children: [new HyperlinkRef("link_"+i)],
                        })],
                        verticalAlign: VerticalAlign.CENTER,
                        margins: {
                          top: 15,
                          bottom: 15,
                          left: 15,
                          right: 15,
                        }
                    }),
                    new TableCell({
                        children:[new Paragraph({text:""+item.siteDetails.info})],//add commas
                        verticalAlign: VerticalAlign.CENTER
                    })
                ]               
            })
        )
        if(format.secondaryTable)
          secondaryPage.push(
            {
                "secondaryTableData_Publication": new TableRow({
                    children: [
                        new TableCell({
                            children: [new Paragraph({text:"Publication "})],
                            verticalAlign: VerticalAlign.CENTER
                        }),
                        new TableCell({
                            children:[new Paragraph({text:publication_name})],
                            verticalAlign: VerticalAlign.CENTER
                        })
                    ]               
                }),             
                "secondaryTableData_Headline": new TableRow({
                    children: [
                        new TableCell({
                            children: [new Paragraph({text:"Headline "})],
                            verticalAlign: VerticalAlign.CENTER
                        }),
                        new TableCell({
                            children:[new Paragraph({
                                children: [new HyperlinkRef("link_"+i)],
                            })],
                            verticalAlign: VerticalAlign.CENTER,
                            margins: {
                              top: 15,
                              bottom: 15,
                              left: 15,
                              right: 15,
                            }
                        })
                    ]               
                }),
                "secondaryTableData_DailyPageViews": new TableRow({
                    children: [
                        new TableCell({
                            children: [new Paragraph({text: typeStr+varietyStr})],
                            verticalAlign: VerticalAlign.CENTER
                        }),
                        new TableCell({
                            children:[new Paragraph({text:""+item.siteDetails.info})],
                            verticalAlign: VerticalAlign.CENTER
                        })
                    ]               
                }),
                "screenShot":new Paragraph({
                     children:[Media.addImage(doc, Buffer.from(item.articleDetails.screenShot, "base64"), 600, 400)]
                })
            }
        ) 

    }

    const mainTable = new Table({
        cantSplit: true,
        columnWidths: [10, 30, 40, 20],
        width: {
            size: 100,
            type: WidthType.PERCENTAGE,
        },
        rows: mainTableRows 
    });

    const image = Media.addImage(doc,  Uint8Array.from(atob(IMAGE_BUFFER), c => c.charCodeAt(0)
      // ,100,100,
      // {
      //   floating: {
      //       horizontalPosition: {
      //           relative: HorizontalPositionRelativeFrom.PAGE,
      //           align: HorizontalPositionAlign.CENTER
      //       },
      //       verticalPosition: {
      //           offset:11000
      //       },
      //   },
      // }
    ));

    doc.addSection({
      headers: {
          default: new Header({
              children: [ new Paragraph(image)],
          })
      },
      children: [mainTable]
    });

    if(format.secondaryTable) 
      for (let i = 0; i < data.length; i++) {
          doc.addSection({
            headers: {
                default: new Header({
                    children: [ new Paragraph(image)],
                })
            },
            children: [returnTableFromRows(secondaryPage[i]), new Paragraph({}), new Paragraph({}), secondaryPage[i].screenShot]
          });    
      }

    console.log("Doc conversion started")
    let start = Date.now();
    Packer.toBlob(doc).then(blob => {//R&D pending!! -  find a way to speed it up
      console.log(blob);
      saveAs(blob, "report.docx");
      console.log("Document created successfully in ",Date.now() - start);
      setLoader(false);
      setDialogCloseBtn(true);
      setTable(false);
    });
  }

  const handleClose = () => {
    setDialog(false);
  };

  // function getBase64(file, cb) {
  //     let reader = new FileReader();
  //     reader.readAsDataURL(file);
  //     reader.onload = function () {
  //         cb(reader.result)
  //     };
  //     reader.onerror = function (error) {
  //         console.log('Error: ', error);
  //     };
  // }

  const genButton = (format) => {
    setDialogCloseBtn(false)
    var reqArr = []
    for (let i = 0; i < Math.ceil(finalList.length/4) ; i++) {
      reqArr.push(axios({
        method:'post',
        url:`${API_URL}/report/gen`,
        headers:{'x-auth-token': store.getState().auth.token},
        data:{
          list:finalList.slice(4*i,4*i+4),
          format
        }
      }))
    }
    axios
      .all(reqArr)
      .then(res=>{
        console.log("Date received from backend")
        var docArr=[];
        console.log(res)
        res.forEach(item => {
          docArr.push(...item.data)
        });
        docxFile(docArr,format)
      })
      .catch(err=>console.log(err))
  }

  const files = acceptedFiles.map(file => {  
    ExcelRenderer(file, (err, resp) => {
      if(err){
        console.log(err);            
      }
      else{
        const {rows , cols} = resp;     
        if( cols.length == 1 ){
          setTable(true)
          var linksKiList = [];
          rows.slice(1).forEach(item => {
            linksKiList.push(item[0])
          });
          setFinalList(linksKiList)
        } else {
          //error handling
        }
      }
    });     
    return (
      <li key={file.path}>
        {file.path} - {file.size} bytes
      </li>
    )}
  );

  return (
    <Page title="Generate Report" >
      <Container>
        <Box mt={3}>
          <Card>
            <CardContent>
              <Typography gutterBottom variant="h1">Generate your report</Typography>
              <div className="container">
                <DropBox {...getRootProps({ className: 'dropzone', isDragActive, isDragAccept, isDragReject })}>{/* Later add Hover styling and others as well */}
                  <input {...getInputProps()} />
                  <h3>Drag 'n' drop some files here, or click on this section to upload files</h3><br/>
                  <h4>Accepted formats xlsx, xls, csv, odf</h4>
                </DropBox>
              </div>
              <br/>
              <br/>
              <Grid container>
                <Grid item xs={6}>
                  {
                    table ? <>
                              <Typography variant="h2">Selected File: 
                                <Typography variant="subtitle1" color="textSecondary">{files}</Typography>
                              </Typography>
                              <br/>
                              <Button variant="contained" color="primary" disableElevation onClick={()=>{ 
                                setDialog(true) 
                                setLoader(true)
                              }}>
                                Select Formating Option
                              </Button>
                            </>
                          : "" 
                  }
                </Grid>
                <Grid item xs={6}>
                  <Typography variant="h2">
                    Instructions
                  </Typography >
                  <Typography variant="h5">
                    <List>
                      <ListItem>
                        <ListItemText
                          primary='1. Drag n drop the file in the section or click on the section to upload the file'
                        />
                      </ListItem>
                      <ListItem>
                        <ListItemText
                          primary='2. Make sure that the file has single column only and value of Row 1 "Links"'
                        />
                      </ListItem>
                      <ListItem>
                        <ListItemText
                          primary='3. Click on "Generate" button'
                        />
                      </ListItem>
                      <ListItem>
                        <ListItemText primary='Note: Make sure that file is only of formats xlsx, xls, csv, odf'/>
                      </ListItem>
                    </List>
                  </Typography>
                </Grid>
              </Grid>                            
            </CardContent>
          </Card>
        </Box>
      </Container>
      <Dialog fullScreen open={dialog} onClose={handleClose} TransitionComponent={Transition}>
        <AppBar>
          <Toolbar>
          {
            dialogCloseBtn ? <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
              <CloseIcon />
            </IconButton> : ""
          }            
          </Toolbar>
        </AppBar>
        <br/><br/>
        <br/><br/>
        <FormatForm genButton={genButton} imgHeader={imgHeader} setimgHeader={setimgHeader}/>
      </Dialog>
    </Page>
  );
}

export default FileDropView;
